import React from 'react'

const Help2 = () => {
  let teacher = [
    {
      id : 1,
      name : "gaurav",
      salary : 5000
    },
    {
      id : 2,
      name : "amar",
      salary : 6000
    }
  ]
  return (
    <>
        <div className='container' style={{minHeight : "650px"}}>
          <table className='table table-dark'>
            <thead>
              <tr>
                <th>S.No.</th>
                <th>Name</th>
                <th>Salary</th>
              </tr>
            </thead>
            <tbody>
              {
                teacher.map((t, n)=>{
                  return(
                    
                    <tr key={t.id}>
                      <td>{t.id}</td>
                      <td>{t.name}</td>
                      <td>{t.saalry}</td>
                    </tr>
                    
                  )
                })
              }
            </tbody>


          </table>
        </div>
    </>
  )
}

export default Help2
